import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { useAuth } from '../contexts/AuthContext';

const ManageJobs = () => {
  const { user } = useAuth();
  const [jobs, setJobs] = useState([]);
  const [editJob, setEditJob] = useState(null);
  const [notes, setNotes] = useState('');

  useEffect(() => {
    const fetchJobs = async () => {
      try {
        const response = await axios.get('/api/jobs', {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
        });
        setJobs(response.data);
      } catch (error) {
        console.error('Error fetching jobs', error);
      }
    };
    fetchJobs();
  }, []);

  const handleEditJob = (job) => {
    setEditJob(job);
    setNotes(job.notes || '');
  };

  const handleCancelJob = async (jobId) => {
    try {
      await axios.delete(`/api/jobs/${jobId}`, {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      setJobs(jobs.filter((job) => job._id !== jobId));
    } catch (error) {
      console.error('Error cancelling job', error);
    }
  };

  const handleSaveJob = async () => {
    try {
      const updatedJob = { ...editJob, notes };
      await axios.put(`/api/jobs/${editJob._id}`, updatedJob, {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      setJobs(jobs.map((job) => (job._id === editJob._id ? updatedJob : job)));
      setEditJob(null);
    } catch (error) {
      console.error('Error saving job', error);
    }
  };

  return (
    <div className="min-h-screen bg-background text-text p-8">
      <h1 className="text-3xl font-bold mb-8">Manage Jobs</h1>

      <div className="mb-8">
        <h2 className="text-2xl font-semibold mb-4">All Jobs</h2>
        <ul className="space-y-4">
          {jobs.map((job) => (
            <li key={job._id} className="bg-surface p-4 rounded shadow flex justify-between items-center">
              <div>
                <p className="font-semibold">{job.job}</p>
                <p>{job.customer.name}</p>
                <p>{new Date(job.date).toLocaleDateString()} at {job.time}</p>
                <p>Recurrence: {job.recurrence}</p>
                {job.notes && <p>Notes: {job.notes}</p>}
              </div>
              <div className="space-x-2">
                <button
                  onClick={() => handleEditJob(job)}
                  className="bg-primary text-white px-2 py-1 rounded"
                >
                  Edit
                </button>
                <button
                  onClick={() => handleCancelJob(job._id)}
                  className="bg-red-500 text-white px-2 py-1 rounded"
                >
                  Cancel
                </button>
              </div>
            </li>
          ))}
        </ul>
      </div>

      {editJob && (
        <div className="mb-8">
          <h2 className="text-2xl font-semibold mb-4">Edit Job</h2>
          <form className="space-y-4">
            <textarea
              value={notes}
              onChange={(e) => setNotes(e.target.value)}
              placeholder="Job Notes"
              className="w-full p-2 border rounded"
              required
            />
            <button
              type="button"
              onClick={handleSaveJob}
              className="bg-primary text-white px-4 py-2 rounded"
            >
              Save
            </button>
          </form>
        </div>
      )}

      <Link to="/dashboard" className="text-primary hover:text-primary-dark">
        Back to Dashboard
      </Link>
    </div>
  );
};

export default ManageJobs;
